import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import "./index.css";
import App from "./App";

var destination = document.querySelector("#container");


ReactDOM.render(
	<BrowserRouter>
		<App/>
	</BrowserRouter>,
    destination
);
